// create a component
const CartPage = ({ navigation }) => {
  return (
    <View style={styles.container}>
      <View style={styles.textHeader}>
        <Text style={styles.text}>Cart</Text>
      </View>
     
    </View>
  );
};

// define your styles
const styles = StyleSheet.create({
  container: {
    flex: 1,

    backgroundColor: "#009387",
  },
  textHeader: {
    marginTop: 80,
    alignItems: "center",
  },
  text: {
    fontWeight: "bold",
    fontSize: 30,
  },
  listitem: {
    overflow: "hidden",
    backgroundColor: "#fff",
    height: "40%",
    borderRadius: 20,
    flexDirection: "row",
  
  },
  itemlist: {
   
  },
  itemimg: {
    width: "30%",
    height: "100%",
  },
  listtext: {
    padding: 20,
  },
});

